       borderRadius: 100,
        justifyContent: "center",
        alignItems: "center",

    colors: {
      ...DefaultTheme.colors,
      primary: 'red',
      accent: 'green',
      text: 'brown',
      background: 'blue',
      surface: 'yellow',
      disabled: 'grey',

    },

    textbox: {
      borderRadius: 20,
      width: 300,
      justifyContent: "center",
      alignItems: "center",
    },

